import React from "react";
import { VStack, FormControl, FormLabel,Input } from "@chakra-ui/react";
export default function SignUp() {
  return (
    <VStack spacing="5px">
      <FormControl>
        <FormLabel><Input/></FormLabel>
      </FormControl>
    </VStack>
  );
}
